const products = [
  {
    id: "1",
    name: "iPhone 12",
    price: 1000,
    category: celular,
    img: "https://thumbs.dreamstime.com/z/ejemplo-del-tel-fono-celular-tel%C3%A9fono-en-el-fondo-blanco-dibujo-pulso-elegante-147669967.jpg",
    stock: 25,
    description: "Descripción de Iphone 12",
  },
  {
    id: "2",
    name: "iPhone 11",
    price: 800,
    category: celular,
    img: "https://thumbs.dreamstime.com/z/ejemplo-del-tel-fono-celular-tel%C3%A9fono-en-el-fondo-blanco-dibujo-pulso-elegante-147669967.jpg",
    stock: 20,
    description: "Descripción de Iphone 12",
  },
  {
    id: "3",
    name: "Tablet",
    price: 1100,
    category: tablet,
    img: "https://thumbs.dreamstime.com/z/ejemplo-del-tel-fono-celular-tel%C3%A9fono-en-el-fondo-blanco-dibujo-pulso-elegante-147669967.jpg",
    stock: 25,
    description: "Descripción de Iphone 12",
  },
];

export const getProducts = () => {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve(products);
    }, 500);
  });
};
